import { useState, useEffect } from "react";
import './App.css';
import { MainContainer } from './component/MainContainer';
import { useDispatch, useSelector } from 'react-redux';
import axios from "axios";
import { initialiseUserInfo } from "./features/user/userSlice";


function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    axios
      .get("http://localhost:5000")
      .then((res) => {
        const names = res.data.data.map((user) => user.name)
        const imageNames = res.data.data.map((user) => user.imageName)
        dispatch(initialiseUserInfo({names:names, imageNames: imageNames}));
      })
      .catch((err) => console.log(err, "it has an error"));
  },[]);


  return (
    <>
      <MainContainer/>
    </>
  );
}

export default App;
